import React, { Component } from "react"; // Perbaiki 'component' menjadi 'Component'
import image from './image'; // Pastikan ini adalah jalur yang benar untuk gambar

class List extends Component { // Perbaiki nama kelas menjadi 'List' (huruf kapital)
    render() {
        return (
            <div>
                <img src={image} alt="Deskripsi gambar" /> {/* Gunakan <img /> untuk menampilkan gambar */}
                <ol>
                    <li>1</li>
                    <li>2</li>
                    <li>3</li>
                    <li>4</li>
                </ol>
            </div>
        );
    }
}

export default List; // Pastikan nama kelas sesuai dengan nama file jika Anda menggunakan konvensi ini
